      <form>
        <>
          <h2>Автор обращения</h2>
          <input placeholder="Имя Фамилия" className={styles.form_item} />
        </>

        {/*  */}
        <div>Тип запроса</div>
        <div></div>
        {/*  */}
        <h2>Добавить описание</h2>
      </form>
    </div>
  )
}

export default Modal
